script: |
  super -f text -I q5809.spq | sort > q5809.out

inputs:
  - name: q5809.spq
    data: |
      SELECT - col1 - col0 FROM tab0 (FORMAT parquet) cor0 WHERE NULL BETWEEN + col1 AND - - col2 OR - 9 / col2 IS NOT NULL;
  - name: tab0

outputs:
  - name: q5809.out
    data: |
      -108
      -96
      -98
